import React from "react";
import ReactDOM from "react-dom";
import MetaTags from 'react-meta-tags';

import App from "./App";
import "./index.css";

ReactDOM.render(
  <React.StrictMode>
    <MetaTags>
      <title>React Calculator</title>
    </MetaTags>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
